import ExpenseItem from "./ExpenseItem";
import './Expenses.css'

function Expenses(props) {
    const ExpenseItem = props.items.map((expense) => {
        return (
            <ExpenseItem
                title={props.items.title}
                amount={props.items.amount}
                date={props.items.date}
            />
        )
    })
}

